import React from "react";

function App() {
  let likes = 0;

  function increment() {
    likes +=1;
  }
  function decrement() {
    likes -=1;
  }

  return (
    <div className="App">
      <h1>{likes}</h1>
      <button onClick={increment}>Increment</button>
      <button onClick={decrement}>Decrement</button>
    </div>
  );
}

export default App;
